import React from "react";
import { Outlet, Link, useLocation } from "react-router-dom";
//import "./MultiUpload.css"; // optional ‚Äî only if you plan to style it

const MultiUpload = () => {
  const location = useLocation();

  return (
    <div className="multi-upload-container">
      <h1 className="multi-upload-title">üçé Multi Apple Upload</h1>

      <div className="multi-upload-nav">
        <Link
          to="/multiupload/step1"
          className={location.pathname.includes("step1") ? "active-step" : ""}
        >
          Step 1: CSV Upload
        </Link>
        <Link
          to="/multiupload/step2"
          className={location.pathname.includes("step2") ? "active-step" : ""}
        >
          Step 2: Image Upload
        </Link>
        <Link
          to="/multiupload/step3"
          className={location.pathname.includes("step3") ? "active-step" : ""}
        >
          Step 3: Review & Submit
        </Link>
      </div>

      <div className="multi-upload-content">
        {/* This renders the current step */}
        <Outlet />
      </div>
    </div>
  );
};

export default MultiUpload;
